{{
(function(){
	const srow =smsTable.selectedRow;
	let rgx = new RegExp(srow.smsRegex)
	let isTest = rgx.test(srow.sampleSms)
	showAlert(isTest)
	const parts = rgx.exec(srow.sampleSms)
	if(isTest) {
				parts.shift()

			showAlert(parts)

	} else {
		showAlert('Error')
	}

})()

}}

children.onRowSelected:
{{
(function() {
	const selectedRow = smsTable.selectedRow
	const smsRegex = selectedRow.smsRegex
	const sampleSms = selectedRow.sampleSms
	const rgxp = new RegExp(smsRegex)
	const parts = rgxp.exec(sampleSms)
	if (parts) {
		parts.unshift()
		showAlert(parts)
	}else{
		showAlert('error')
	}
})()

}}

